import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Crud App with MERN</h1>

      <label>Food Name:</label>
      <input type="text"/>
      <label>Days Since:</label>
      <input type="number"/>
      <button>Add to list</button>
    </div>
  );
}

export default App;
